INSERT INTO `artikel` (`id`, `judul`, `id_kategori`, `isi`, `gambar`, `tanggal`) VALUES
(1, 'Jurusan Informatika UNTAN Mengadakan Webinar Nasional', 2, '<p>Jurusan Informatika Universitas Tanjungpura akan mengadakan Webinar dengan topik<br />\r\n&quot;Peran Machine Learning Dalam Transformasi Digital : Praktik dan Teori&quot; dan menunjuk HMIF (Himpunan Mahasiswa Informatika) sebagai panitia pelaksana kegiatan tersebut. Webinar ini akan dilaksanakan pada tanggal 10 Juni 2020, pukul 09.00, via Zoom (online).<br />\r\n<br />\r\nWebinar yang dilaksanakan erat kaitannya dengan Big Data. Big Data saat ini menjadi topik yang sangat sering diperbincangkan, mengingat perubahan zaman yang sudah menjadi era informasi, maka akan banyak sekali data yang harus diolah, namun dalam mengolah data tersebut butuh teknologi yang namanya Machine Learning. Tentu Machine Learning sangat penting bagi perkembangan teknologi di Indonesia bahkan dunia, karena berbagai manfaatnya, seperti untuk membantu menganalisa data, mengambil suatu keputusan, dan meramalkan masa depan.<br />\r\n<br />\r\nMateri webinar ini akan disampaikan oleh Pak Dr.rer.nat. Fal Sadikin dan Pak Dr. Arif Bijaksana Putra Negara,S.T.,M.T. Serta Pak Enda Esyudha Pratama,S.T.,M.T. sebagai moderatornya. Pak Arif akan memulai dengan menyampaikan teori dan dilanjutkan oleh Pak Fal yang akan menyampaikan praktik. Harapannya materi seminar yang disampaikan akan dapat menjadi insight bagi peserta yang mengikuti webinar ini.</p>\r\n', 'WhatsApp-Image-2020-06-09-at-12_04_091-1024x5761.jpeg', '2021-07-29'),
(2, 'Universitas Tanjungpura Meluncurkan Kendaraan Berbasis Mobil Listrik Yang Diberi Nama Kapuas 1', 3, '<p>Kegiatan Launching mobil listrik ini diresmikan langsung oleh Rektor Universtas Tanjungpura, Prof Garuda Wiko. Beliau memaparkan &ldquo;Bahwa terciptanya mobil listrik Kapuas 1 oleh mahasiswa Fakultas Teknik sebagai bentuk dan upaya Universitas Tanjungpura Pontianak dalam ikut serta untuk melahirkan sebuah karya nyata berbasis ilmu, pengetahuan dan teknologi&rdquo;.</p>\r\n\r\n<p><img alt=\"\" height=\"576\" sizes=\"(max-width: 1024px) 100vw, 1024px\" src=\"http://teknik.untan.ac.id/wp-content/uploads/2020/12/05-1024x576.jpg\" srcset=\"https://teknik.untan.ac.id/wp-content/uploads/2020/12/05-1024x576.jpg 1024w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/05-300x169.jpg 300w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/05-768x432.jpg 768w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/05-1536x864.jpg 1536w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/05-255x143.jpg 255w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/05-600x338.jpg 600w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/05.jpg 1920w\" width=\"1024\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mobil Listrik Kapuas 1, dikerjakan oleh tim dari Fakultas Teknik, dengan gabungan dari prodi Elektro, Industri dan Mesin.</p>\r\n\r\n<p><img alt=\"\" height=\"681\" sizes=\"(max-width: 1024px) 100vw, 1024px\" src=\"http://teknik.untan.ac.id/wp-content/uploads/2020/12/DSC_0062-1-1024x681.jpg\" srcset=\"https://teknik.untan.ac.id/wp-content/uploads/2020/12/DSC_0062-1-1024x681.jpg 1024w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/DSC_0062-1-300x199.jpg 300w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/DSC_0062-1-768x511.jpg 768w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/DSC_0062-1-1536x1021.jpg 1536w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/DSC_0062-1-2048x1362.jpg 2048w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/DSC_0062-1-255x170.jpg 255w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/DSC_0062-1-600x399.jpg 600w\" width=\"1024\" /></p>\r\n\r\n<p><img alt=\"\" height=\"576\" sizes=\"(max-width: 1024px) 100vw, 1024px\" src=\"http://teknik.untan.ac.id/wp-content/uploads/2020/12/03-1024x576.jpg\" srcset=\"https://teknik.untan.ac.id/wp-content/uploads/2020/12/03-1024x576.jpg 1024w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/03-300x169.jpg 300w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/03-768x432.jpg 768w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/03-1536x864.jpg 1536w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/03-255x143.jpg 255w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/03-600x338.jpg 600w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/03.jpg 1920w\" width=\"1024\" /></p>\r\n\r\n<p><img alt=\"\" height=\"576\" sizes=\"(max-width: 1024px) 100vw, 1024px\" src=\"http://teknik.untan.ac.id/wp-content/uploads/2020/12/02-1024x576.jpg\" srcset=\"https://teknik.untan.ac.id/wp-content/uploads/2020/12/02-1024x576.jpg 1024w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/02-300x169.jpg 300w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/02-768x432.jpg 768w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/02-1536x864.jpg 1536w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/02-255x143.jpg 255w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/02-600x338.jpg 600w, https://teknik.untan.ac.id/wp-content/uploads/2020/12/02.jpg 1920w\" width=\"1024\" /></p>\r\n', '04.jpg', '2021-07-29'),
(3, 'Mahasiswa dan Dosen Informatika Untan Laksanakan Study Excursion 2019 di Kucing-Malaysia', 1, '<p>Mahasiswa dan Dosen Informatika Untan Laksanakan Study Excursion 2019 di Kucing-Malaysia. Pelakssanaan kegiatan ini sudah memasuki tahun ketiga. Adapun tempat-tempat yang dikunjungi yaitu Universitas Malaysia Sarawak (UNIMAS), Konsultan Jenderal Republik Indonesia, Sarawak Multimedia Authority (SMA), dan I-Cube Innovation. Kegiatan ini dilaksanakan pada 17-20 November 2019.<br />\r\n<br />\r\n<img alt=\"\" height=\"342\" src=\"https://informatika.untan.ac.id/wp-content/uploads/2019/11/WhatsApp-Image-2019-11-18-at-13.45.51.jpeg\" width=\"540\" /><br />\r\n<br />\r\n<img alt=\"\" height=\"342\" src=\"https://informatika.untan.ac.id/wp-content/uploads/2019/11/WhatsApp-Image-2019-11-18-at-09.02.48.jpeg\" width=\"540\" /><br />\r\n<br />\r\n<img alt=\"\" height=\"342\" src=\"https://informatika.untan.ac.id/wp-content/uploads/2019/11/IMG_8464.jpg\" width=\"540\" /><br />\r\n<br />\r\n<img alt=\"\" height=\"342\" src=\"https://informatika.untan.ac.id/wp-content/uploads/2019/11/IMG_8543.jpg\" width=\"540\" /><br />\r\n<br />\r\n<img alt=\"\" height=\"342\" src=\"https://informatika.untan.ac.id/wp-content/uploads/2019/11/IMG_8577.jpg\" width=\"540\" /></p>\r\n', 'IMG_5613.jpg', '2021-07-30');
