(1, 'Pengurus Harian', 'Pengurus Harian bertujuan untuk mengorganisir dan memobilisasi jalannya aktivitas HMIF FT UNTAN.', 'PENGURUS HARIAN', 'ph', 'ph.php', 'ph.svg'),
(2, 'Usaha Dana, Profesi dan Jasa', 'Divisi UDPJ bertujuan untuk Menjalin hubungan baik dengan mitra kerja dan mengusahakan pendanaan organisasi dengan jalan yang halal serta Mengembangkan potensi keahlian keprofesian anggota HMIF FT UNTAN dan menyediakan sumber daya yang berkompeten di bidang Informatika.', 'UDPJ', 'udpj', 'udpj.php', 'udpj.svg'),
(3, 'Sumber Daya Mahasiswa', 'Divisi SDM bertujuan untuk Membina dan meningkatkan kemampuan anggota dalam memiliki kerangka berpikir dengan tujuan pengembangan dan kesinambungan organisasi untuk mempersiapkan lulusan yang berkompeten.', 'SDM', 'sdm', 'sdm.php', 'sdm.svg'),
(4, 'Kesejahteraan Rumah Tangga', 'Divisi KESRUT bertujuan untuk Melakukan pembenahan, pengembangan dan pemeliharaan sarana dan prasarana yang ada di lingkungan sekretariat HMIF FT UNTAN dan Menjadikan HMIF FT UNTAN sebagai pusat aktivitas Studi mahasiswa Jurusan Informatika Fakultas Teknik Universitas Tanjungpura yang ideal.', 'KESRUT', 'kesrut', 'kesrut.php', 'kesrut.svg'),
(5, 'Pendidikan dan Riset Teknologi', 'Divisi PENRISTEK bertujuan untuk Membentuk kader yang memiliki <i>hard skill</i> dan <i>soft skill</i> serta Menjadi wadah pusat studi ilmiah di bidang IT.', 'PENRISTEK', 'penristek', 'penristek.php', 'penristek.svg'),
(6, 'Komunikasi dan Informasi', 'Divisi KOMINFO bertujuan untuk Mensosialisasikan dan meningkatkan eksistensi HMIF FT UNTAN.', 'KOMINFO', 'kominfo', 'kominfo.php', 'kominfo.svg');
