INSERT INTO `profil_detail` (`id_detail`, `menu_detail`, `id_profil_menu`, `detail`) VALUES
(1, 'Tentang Kami', 1, 'Himpunan Mahasiswa Informatika Fakultas Teknik Universitas Tanjungpura atau yang disingkat HMIF FT UNTAN adalah Organisasi Kemahasiswaan yang berfungsi sebagai wadah komunikasi, sarana pembinaan dan pengembangan sikap, mental, akademis serta intelektual yang menjunjung tinggi keimanan dan ketaqwaan kepada Tuhan Yang Maha Esa di Jurusan Informatika Fakultas Teknik Universitas Tanjungpura'),
(2, 'Visi', 2, 'Mewujudkan Himpunan Mahasiswa Informatika UNTAN sebagai organisasi yang memiliki pribadi-pribadi yang unggul dan profesional.'),
(3, 'Misi', 2, 'Menjadikan Himpunan sebagai sarana untuk meningkatkan kualitas pribadi yang memiliki jiwa tanggung jawab dalam menjalankan amanah.;Menciptakan HMIF FT UNTAN sebagai wadah dalam menampung dan menyalurkan aspirasi seluruh anggotanya.;Meningkatkan kebersamaan dan kekeluargaan diantara seluruh mahasiswa Informatika UNTAN.;Berperan aktif dalam mengembangkan dan memajukan teknologi informasi secara global'),
(4, 'Tujuan', 3, 'HMIF FT UNTAN berfungsi sebagai wadah komunikasi, sarana pembinaan dan pengembangan sikap, mental, akademis serta intelektual yang menjunjung tinggi keimanan dan ketaqwaan kepada Tuhan Yang Maha Esa di Jurusan Informatika Fakultas Teknik Universitas Tanjungpura.'),
(5, 'Fungsi', 3, 'Ikut mengusahakan tercapainya tujuan nasional dalam bentuk kegiatan ekstrakurikuler di dalam maupun di luar kampus yang bersifat sukarela.;Mengembangkan kemampuan keprofesian mahasiswa Jurusan Informatika tanpa melupakan hal-hal lain di luar masalah keprofesian.');
